import React from 'react';
import { Link } from 'react-router-dom'; // If using React Router for routing

const Anklets = () => {
  return (
    <div className="anklets-list">
      <Link to="/product/1">
        <div className="product-card">
          <img src="path-to-image.jpg" alt="Evil Eye Bracelet" />
          <h3>Evil Eye Bracelet</h3>
          <p>Price: ₹250</p>
          <p>Original Price: ₹500</p>
        </div>
      </Link>
      {/* Repeat for other products */}
    </div>
  );
}

export default Anklets;
